import "./styles.css";
import React from 'react';
import { Loader } from '@googlemaps/js-api-loader';


class App extends React.Component {
    render() {
        return <div className="App">
            <h1>Hello Testing</h1>
            <h2>Start editing to see some magic happen!</h2>
            <div id="mapContainer"><Map /></div>
        </div>;
    }
}

class Map extends React.Component {
    constructor(props) {
        super(props);
    }

    loader = new Loader({
        apiKey: "AIzaSyD8Vp_eqij2KVTiHCTi9mQgKaGCAZ5FRDQ",
        version: "weekly",
        libraries: ["places"]
    });

    mapOptions = {
        center: {
            lat: -25.344, lng: 131.031
        },
        draggable: true,
        mapTypeId: 'terrain',
        zoom: 4
    };

    render() {
        return (<div id="map"></div>);
    }


    componentDidMount() {
        this.loader
            .load()
            .then((google) => {
                new google.maps.Map(document.getElementById("map"), this.mapOptions);
            })
            .catch(e => {
                // do something
            });
    }

